text:
𝕋ℍ𝔼 𝔹𝔼𝔸𝕌𝕋𝕐 𝕆𝔽 𝔹ℝ𝔼𝔸𝕂𝕀ℕ𝔾... #makeupformentalhealth
@makeuprevolution @iheartrevolution
#mondayblues #bluemonday

i first saw this beautiful tradition a couple months ago on the bbc 
it's called 
#kintsugi --golden joinery-- also known as #kintsukuroi --golden repair-- is the japanese art of repairing broken pottery with lacquer dusted or mixed with powdered gold, silver, or platinum,
as a philosophy, it treats breakage  and repair as part of the history of an object, rather than something to disguise.

my journey has been a tough and bumpy road so far and i have broken and rebuilt and i will not hide any more . it's my path... it's not perfect ... but its mine and it's beautiful. 
inspiration drawn from @jodiehulme @jamescharles 
#blankcanvas #startingover #broken #beauty #breaking #domesticviolence #survivor #stronger #jointherevolution  #myjourney #youa

don't forgive and forget... remember and recover 
i love you all x
---♡---♡---♡---♡---♡---♡---♡---♡---♡------♡---♡---♡---♡---♡---♡---♡---♡---♡---
