text:
even with the challenges of obtaining clear data (because of differences in reporting methodologies and the fact that many studies focus on cis-gendered heterosexual white women), the comparative differences in survivorship by ethnicity are clear. (see link in profile for more detail.)
so while it may be tempting – especially after the events of this past weekend, and the still very much alive conversation regarding #survivingrkelly – to want to focus on "peace and unity" today, it’s far more important and productive to tell it like it is. ✒🖤
@thewordforthis

